import { BrowserRouter as Router, Route } from 'react-router-dom'
import PageRender from './PageRender';

import {

  Routes

} from "react-router-dom";

function App() {
  return (
    <Router>
      <input type="checkbox" id="theme" />
      <div className="App">
        <div className="main">

          <Routes>
            <Route path="/:page" component={PageRender} /></Routes>

        </div>  </div>
    </Router>);
}

export default App;
